%sh

echo "sgcsvlisting = load 'hdfs://sandbox-hdp.hortonworks.com:8020/sglistings/listings.csv' using PigStorage(',') AS (accommodates:Long, amenities:chararray, availability_30:Long, availability_365:Long, availability_60:Long, availability_90:Long, bathrooms:Double, bedrooms:Double, beds:Double, calculated_host_listings_count:Long, calculated_host_listings_count_entire_homes:Long, calculated_host_listings_count_private_rooms:Long, calculated_host_listings_count_shared_rooms:Long, calendar_last_scraped:chararray, has_availability:chararray, host_id:Long, host_url:chararray, host_verifications:chararray, id:Long, instant_bookable:chararray, last_scraped:chararray, latitude:Double, listing_url:chararray, longitude:Double, maximum_maximum_nights:Long, maximum_minimum_nights:Long, maximum_nights:Long, maximum_nights_avg_ntm:Double, minimum_maximum_nights:Long, minimum_minimum_nights:Long, minimum_nights:Long, minimum_nights_avg_ntm:Double, neighbourhood_cleansed:chararray, neighbourhood_group_cleansed:chararray, number_of_reviews:Long, number_of_reviews_ltm:Long, picture_url:chararray, price:chararray, property_type:chararray, review_scores_accuracy:Double, review_scores_checkin:Double, review_scores_cleanliness:Double, review_scores_communication:Double, review_scores_location:Double, review_scores_rating:Double, review_scores_value:Double, room_type:chararray, scrape_id:Long);
-- DUMP sgcsvlisting;
STORE sgcsvlisting INTO 'singapore_listings_hivepig' USING org.apache.hive.hcatalog.pig.HCatStorer();" > sglisting.pig
#'singapore_listings_pig' USING  org.apache.hive.hcatalog.pig.HCatStorer();
#hdfs://localhost:9000/pig_Output/ ' USING PigStorage (',')

pig -useHCatalog sglisting.pig
